import { StyleSheet } from "react-native"

export const styleHome = StyleSheet.create({
    home__div: {
        backgroundColor: "#1c2295",
        height: 125,
        width: "100%"
    },
    home__title: {
        fontSize: 30,
        alignItems: "center",
        textAlign: "center",
        marginTop: 50,
        color: "#fff",
        textDecorationLine: "underline"
    }
})
